import cl from "./Tabs.module.scss";
import STAR from "../../../assets/images/icons/favos.svg";

export const Tabs = () => {
  return (
    <div className={cl.tabs}>
      <div className={cl.tab}>
        <img src={STAR} className={cl.star} alt="" /><p>Популярне</p>
      </div>
      <div className={cl.tab}>
      <span>&#9829;</span><p>Улюблене</p>
      </div>
    </div>
  );
};
